class Solution(object):
    def loudAndRich(self, richer, quiet):
        """
        :type richer: List[List[int]]
        :type quiet: List[int]
        :rtype: List[int]
        """
        np = len(quiet)
        rp = {}
        for i,v in enumerate(richer):
            rich,poor = v[0],v[1]
            rp[rich] = rp.get(rich, set())
            rp[poor] = rp.get(poor, set())
            rp[poor] |=  set([v[0]])
            rp[poor] |=  rp[rich]
        #for i in rp: print i, rp[i]

        def dfs(rp,idx,visit):
            if not rp[idx]: return set([idx])
            visit.add(idx)
            val =set()
            for p in rp[idx]:
                if p not in visit:
                    val|=dfs(rp,p,visit)
            rp[idx] |= val
            return rp[idx]
        
        visit = set()
        for i in range(np):
            if i not in visit and i in rp: dfs(rp,i,visit)
            
        #for i in rp: print i, rp[i]
        ans=[]
        for i in range(np):
            richer = rp[i] if rp.has_key(i) else set()
            richer |= set([i])
            #print i,richer
            mv,mp = 1000,-1
            for p in richer:
                if mv > quiet[p]: 
                    mv = quiet[p]
                    mp = p
            ans.append(mp)
        return ans
        
